Bali gave me good memories, but those came with dark spots! Sun exposure is the number one reason for dark spots and with vacay season coming in - we need a solution ⛅️

@lorealparis has come to our rescue with the L’Oréal Paris Glycolic Bright Serum and Invisible Resist Sunscreen. The serum is packed with Melasyl - a recent breakthrough that treats dark spots, while the sunscreen helps prevent new dark spots from forming! 💌

